From the current Expo docs (latest, aligned with the 2026 timeframe), AsyncStorage is the recommended unencrypted, persistent key‑value store for small local data in Expo SDK 54. Steps:

1) Install:
```bash
npx expo install @react-native-async-storage/async-storage
```

2) Use it to write/read JSON-safe values (stringify objects):
```ts
import AsyncStorage from '@react-native-async-storage/async-storage';

const savePrefs = async () => {
  await AsyncStorage.setItem('prefs', JSON.stringify({ theme: 'light' }));
};

const loadPrefs = async () => {
  const raw = await AsyncStorage.getItem('prefs');
  return raw ? JSON.parse(raw) : null;
};
```

3) Remember it’s unencrypted; for sensitive data use `expo-secure-store`.

Sources:  
- `https://docs.expo.dev/versions/latest/sdk/async-storage/`  
- `https://docs.expo.dev/develop/user-interface/store-data/`  
- `https://react-native-async-storage.github.io/async-storage/docs/usage`

